[[package]]
name = "anyio"
version = "3.6.1"
requires_python = ">=3.6.2"
summary = "High level compatibility layer for multiple asynchronous event loop implementations"
dependencies = [
    "idna>=2.8",
    "sniffio>=1.1",
    "typing-extensions; python_version < \"3.8\"",
]

[[package]]
name = "attrs"
version = "22.1.0"
requires_python = ">=3.5"
summary = "Classes Without Boilerplate"

[[package]]
name = "cattrs"
version = "22.1.0"
requires_python = ">=3.7,<4.0"
summary = "Composable complex class support for attrs and dataclasses."
dependencies = [
    "attrs>=20",
    "exceptiongroup; python_version <= \"3.10\"",
    "typing-extensions; python_version >= \"3.7\" and python_version < \"3.8\"",
]

[[package]]
name = "certifi"
version = "2022.6.15"
requires_python = ">=3.6"
summary = "Python package for providing Mozilla's CA Bundle."

[[package]]
name = "exceptiongroup"
version = "1.0.0rc9"
requires_python = ">=3.7"
summary = "Backport of PEP 654 (exception groups)"

[[package]]
name = "h11"
version = "0.12.0"
requires_python = ">=3.6"
summary = "A pure-Python, bring-your-own-I/O implementation of HTTP/1.1"

[[package]]
name = "httpcore"
version = "0.15.0"
requires_python = ">=3.7"
summary = "A minimal low-level HTTP client."
dependencies = [
    "anyio==3.*",
    "certifi",
    "h11<0.13,>=0.11",
    "sniffio==1.*",
]

[[package]]
name = "httpx"
version = "0.23.0"
requires_python = ">=3.7"
summary = "The next generation HTTP client."
dependencies = [
    "certifi",
    "httpcore<0.16.0,>=0.15.0",
    "rfc3986[idna2008]<2,>=1.3",
    "sniffio",
]

[[package]]
name = "idna"
version = "3.3"
requires_python = ">=3.5"
summary = "Internationalized Domain Names in Applications (IDNA)"

[[package]]
name = "rfc3986"
version = "1.5.0"
summary = "Validating URI References per RFC 3986"

[[package]]
name = "rfc3986"
version = "1.5.0"
extras = ["idna2008"]
summary = "Validating URI References per RFC 3986"
dependencies = [
    "idna",
    "rfc3986==1.5.0",
]

[[package]]
name = "sniffio"
version = "1.3.0"
requires_python = ">=3.7"
summary = "Sniff out which async library your code is running under"

[[package]]
name = "typing-extensions"
version = "4.3.0"
requires_python = ">=3.7"
summary = "Backported and Experimental Type Hints for Python 3.7+"

